import React from 'react';
import { Line } from '@ant-design/charts';

function Page(){
  const data = [
    { year: '10:00', value: 3 },
    { year: '12:00', value: 4 },
    { year: '14:00', value: 3.5 },
    { year: '16:00', value: 5 },
    { year: '18:00', value: 4.9 },
    { year: '20:00', value: 6 },
    { year: '22:00', value: 7 },
    { year: '00:00', value: 9 },
    { year: '02:00', value: 13 },
    { year: '04:00', value: 13 },
    { year: '06:00', value: 13 },
    { year: '08:00', value: 13 },
  ];

  const config = {
    data,
    height: 400,
    xField: 'year',
    yField: 'value',
    point: {
      size: 5,
      shape: 'diamond',
    },
    label: {
      style: {
        fill: '#aaa',
      },
    },
  };
  return <Line {...config} />;
};
export default Page;
